Att administrera en dators resurser (to manage the resources of a computer), vilket bl.a. innebär.:
i) att övervaka driften av datorn (to oversee the operation of the computer);
ii) att spara och hämta filer (to store and retrieve files);
iii) att schemalägga program för exekvering (to schedule programs for execution);
iv) att koordinera exekveringen av program (to ccordinate the execution of programs).

ans_en:
"To manage the resources of a computer", which means, among other things: 
i) to supervise the operation of the computer (to oversee the operation of the computer);
ii) to store and retrieve files;
iii) to schedule programs for execution (to schedule programs for execution);
iv) to coordinate the execution of programs."

ans_se:
Oversee the operation of a computer; 
store and retrieve files; 
schedule programs for execution; 
coordinate the execution of programs.

ans_en:
Oversee the operation of a computer; 
store and retrieve files; 
schedule programs for execution; 
coordinate the execution of programs.

