q_en:
What generation of programming languages is characterized by:
- machine independent (mostly);
- each primitive corresponds to a sequence of machine language instructions?

What are software engineering methods called that value: - individuals and interactions over processes and tools;
- working software over comprehensive documentation;
- customer collaboration over contract negotiation;
- responding to change over following a plan.

Which four of the following things do they value in the Agile Manifesto?
a) contract negotiations; b) individuals and interactions; c) responding to change;
d) customer collaboration; e) processes and tools; f) working software;
g) comprehensive documentation; h) following a plan.
